import React from "react";
import { Redirect, useParams } from "react-router-dom";

export const Parametro = ({ history }) => {
  const params = useParams();
  if (!params) {
    return <Redirect to="/"></Redirect>;
  }

  const handleReturn = () => {
    if (history.lenght <= 2) {
      history.push("/");
    } else {
      history.goBack();
    }
  };

  return (
    <div>
      <button className="btn-primary" onClick={handleReturn}>
        Volver
      </button>
    </div>
  );
};
